import React, { useState } from 'react';
import { autenticarUsuario } from '../services/api';
import { FaGoogle, FaFacebook } from 'react-icons/fa';

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [tokenAccess, setTokenAccess] = useState('');
  const [resultado, setResultado] = useState(null);

  const handleLogin = async () => {
    const data = await autenticarUsuario(email, password, tokenAccess);
    setResultado(data);
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100 dark:bg-gray-800">
      <div className="bg-white dark:bg-gray-700 p-6 rounded-lg shadow-lg w-full max-w-md">
        <h1 className="text-2xl font-bold text-center text-nba-blue dark:text-phoenixsuns-yellow mb-6">
          Login
        </h1>

        {/* Campo de E-mail */}
        <div className="mb-4">
          <label htmlFor="email" className="block text-sm font-medium text-gray-600 dark:text-gray-200">
            E-mail
          </label>
          <input
            type="email"
            id="email"
            placeholder="Digite seu e-mail"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md dark:bg-gray-800 dark:text-white dark:border-gray-600 focus:outline-none focus:ring-2 focus:ring-nba-blue dark:focus:ring-phoenixsuns-yellow"
          />
        </div>

        {/* Campo de Senha */}
        <div className="mb-4">
          <label htmlFor="password" className="block text-sm font-medium text-gray-600 dark:text-gray-200">
            Senha
          </label>
          <input
            type="password"
            id="password"
            placeholder="Digite sua senha"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md dark:bg-gray-800 dark:text-white dark:border-gray-600 focus:outline-none focus:ring-2 focus:ring-nba-blue dark:focus:ring-phoenixsuns-yellow"
          />
        </div>

        {/* Campo de Token Access */}
        <div className="mb-4">
          <label htmlFor="tokenAccess" className="block text-sm font-medium text-gray-600 dark:text-gray-200">
            Token Access
          </label>
          <input
            type="text"
            id="tokenAccess"
            placeholder="Digite seu token"
            value={tokenAccess}
            onChange={(e) => setTokenAccess(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md dark:bg-gray-800 dark:text-white dark:border-gray-600 focus:outline-none focus:ring-2 focus:ring-nba-blue dark:focus:ring-phoenixsuns-yellow"
          />
        </div>

        {/* Esqueceu sua senha */}
        <div className="mb-6 text-right">
          <a href="#" className="text-sm text-nba-blue dark:text-phoenixsuns-yellow hover:underline">
            Esqueceu sua senha?
          </a>
        </div>

        {/* Botões de Rede Social */}
        <div className="flex justify-between gap-4 mb-6">
          <button className="flex items-center justify-center w-1/2 p-4 bg-red-600 text-white rounded-md hover:bg-red-700 transition-all duration-300">
            <FaGoogle className="text-2xl mr-2" />
            Entrar com o Google
          </button>
          <button className="flex items-center justify-center w-1/2 p-4 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-all duration-300">
            <FaFacebook className="text-2xl mr-2" />
            Entrar com o Facebook
          </button>
        </div>

        {/* Botão Entrar */}
        <button
          onClick={handleLogin}
          className="w-full p-4 bg-nba-blue text-white rounded-md shadow-md hover:bg-nba-red dark:hover:bg-orange-500 transition-all duration-300"
        >
          Entrar
        </button>

        {/* Resultado da autenticação */}
        {resultado && (
          <div className="mt-6 bg-gray-100 dark:bg-gray-800 p-4 rounded-md shadow">
            <h2 className="text-lg font-bold text-gray-700 dark:text-gray-200 mb-2">Resultado:</h2>
            <pre className="text-sm text-gray-600 dark:text-gray-400">
              {JSON.stringify(resultado, null, 2)}
            </pre>
          </div>
        )}
      </div>
    </div>
  );
}

export default LoginPage;
